import React from 'react';
import Cell from './Cell'
import './Table.css';

const Table = () => {
    const [turn, setTurn] = useState();
    const [cells, setCells] = useState(Array(9).fill(''));

    return (
        <div className="container">
            <table className="table">
                <tbody>
                    <tr>
                        <Cell id={0} />
                        <Cell id={1} />
                        <Cell id={2} />
                    </tr>
                    <tr>
                        <Cell id={3} />
                        <Cell id={4} />
                        <Cell id={5} />
                    </tr>
                    <tr>
                        <Cell id={6} />
                        <Cell id={7} />
                        <Cell id={8} />
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default Table;
